import React from 'react';
import "./projects.css";
import proj1 from '../../collateral/services/programming.jpg'
import proj2 from '../../collateral/services/programming.jpg'
import proj3 from '../../collateral/services/programming.jpg'
import proj4 from '../../collateral/services/programming.jpg'


const projectsdata = [
  {
      id: 1,
      image: proj1,
      title: "Programming",
      desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
  },
  {
      id: 2,
      image: proj2,
      title: "Technical Support",
      desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
  },
  {
      id: 3,
      image: proj3,
      title: "UI/UX Design",
      desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
  },
  {
      id: 4,
      image: proj4,
      title: "Graphic Design",
      desc: "Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua."
  }
]

const modal =  ({ isOpen, onClose, children, contentClassName, contentWrapper}) => {
  if (! isOpen) return null;

  const ContentWrapper = contentWrapper || React.Fragment

  return (
    <div className="modal">
      <div className="modal-content">
      <span className="close" onClick={onClose}>&times;</span>
      <ContentWrapper className={contentClassName}>{children}</ContentWrapper>
      </div>
    </div>
  );
};

const Projects = () => {
  return (
    <section className="services section">
        <h2 className="services-section-title">Service <span className="services-section-title-line"></span></h2>
        <div className="services-container">
            {projectsdata.map(({id, image, title, desc}) => {
                return (
                    <div className="services-card-id" key={id}>
                        <img className="services-image" src={image} alt=''/>
                        <h3 className="services-title">{title}</h3>
                        <p className="services-description">{desc}</p>
                    </div>
                );
            }

            )}
        </div>
    </section>
  )
}

export default Projects
